import React from 'react';
import {Link} from 'react-router-dom';

const Accuil = ({history,match}) => {



    return ( <>
    <div className="homeP">
        <div className="titreA">
    
    </div>
         <div className="pres jumbotron jumbotron-fluid">
               <div className="container">
                    <h2 className="display-4">Yanis Alim</h2>
                    <p className="lead">Autonome, rigoureux et passionné, dans le cadre de ma formation, je suis à la recherche d’une alternance a partir de septembre 2021,en développement ou bi et Big Data. Je saurai mettre à profit toutes mes compétences et mes qualités pour votre entreprise. </p>
               </div>        
         </div>
    </div>
     </> );
}
 
export default Accuil;
